import React from "react";

class SearchBar extends React.Component {
  state = { searchInput: "" };
  render() {
    return (
      <div>
        <form class="d-flex">
          <input
            class="form-control me-2"
            type="search"
            placeholder="Search"
            aria-label="Search"
            onChange={(e)=>this.setState.searchInput={}}
          />
        </form>
      </div>
    );
  }
}

export default SearchBar;
